window.bookSummaryJSON = "<p>Sunshine, rainbows and unicorns? Yeah something's gotta give.</p> <p>Kick her while she’s down seems to be the motto when it comes to my life. But this time I’m clawing back. Hard.</p> <p>After the uncertainty and the heartache, I deserve a reprieve, and I’m damn well going to get it. My own personal happy ever after.</p> <p>But what they don’t tell you in the fairy tales is that happily ever after comes with a price. In my case, it’ll likely be one that kicks me in the teeth.</p> <p>Sometimes I bloody hate it when I’m right!</p> <p>A kick-ass urban fantasy romance, filled with vampires, ghosts, angels, and demons. Perfect for listeners who enjoy forbidden romance, enemies to lovers or friends to lovers.</p>"; 
